import React, { useEffect, useState } from 'react';

function App() {
  const [backendData, setBackendData] = useState([]);

  useEffect(() => {
    fetch('/nastavnici')
      .then((response) => response.json())
      .then((data) => {
        setBackendData(data);
      });
  }, []);

  return;
  <>
    <div>
      backendData.nastavnici.map((user,let i) => {<p key={i}>{user}</p>})
    </div>
    ;
  </>;
}

export default App;
